INSERT INTO `products` VALUES ('9c6e8d7c-4b00-4ca0-98f0-5bfdfafe0ef8','{\"de\":\"Klassisches Baumwoll-T-Shirt\",\"fr\":\"T-shirt classique en coton\",\"en\":\"Classic Cotton T-Shirt\"}','classic-cotton-t-shirt','{\"de\":\"Zeitloser Stil in diesem klassischen Baumwoll-T-Shirt.\",\"fr\":\"Style intemporel dans ce t-shirt classique en coton.\",\"en\":\"Timeless style in this classic cotton t-shirt.\"}','{\"de\":\"Werten Sie Ihren l\\u00e4ssigen Look mit diesem klassischen Baumwoll-T-Shirt auf. Das zeitlose Design und die hochwertige Baumwolle machen es perfekt f\\u00fcr jeden Anlass. Ob f\\u00fcr einen Tag mit Freunden oder einen entspannten Abend, dieses T-Shirt bietet sowohl Stil als auch Komfort. Erh\\u00e4ltlich in verschiedenen Farben, passend zu Ihrem Look.\",\"fr\":\"Am\\u00e9liorez votre look d\\u00e9contract\\u00e9 avec ce t-shirt classique en coton. Son design intemporel et son coton de haute qualit\\u00e9 le rendent parfait pour toutes les occasions. Que ce soit pour une journ\\u00e9e entre amis ou une soir\\u00e9e d\\u00e9contract\\u00e9e, ce t-shirt offre \\u00e0 la fois style et confort. Disponible en diff\\u00e9rentes couleurs pour correspondre \\u00e0 votre look.\",\"en\":\"Elevate your casual look with this Classic Cotton T-Shirt. The timeless design and high-quality cotton make it perfect for any occasion. Whether for a day out with friends or a relaxed evening, this t-shirt offers both style and comfort. Available in various colors to match your look.\"}',16.99,'{\"de\":\"Zeitlose Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance intemporelle\",\"en\":\"Timeless Elegance\"}','{\"de\":\"Perfekt f\\u00fcr lockere Anl\\u00e4sse und entspannte Abende.\",\"fr\":\"Parfait pour les occasions d\\u00e9contract\\u00e9es et les soir\\u00e9es d\\u00e9tendues.\",\"en\":\"Perfect for casual occasions and relaxed evenings.\"}',1,0,229,150,'M-T001',0,220,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-t-shirts-1.jpg\", \"file_name\": \