39;humidit\\u00e9 pour plus de confort pendant l&#39;exercice.\",\"en\":\"Moisture-wicking fabric for comfort during exercise.\"}',2,0,162,180,'M-T002',0,230,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-t-shirts-2.jpg\", \"file_name\": \"mens-t-shirts-2.jpg\"}','[\"9c6e8d6c-744c-4743-a97d-97da25389442\", \"9c6e8d6c-3bbd-4f7f-af28-afbd08fdee29\", \"9c6e8d6b-fb2e-4785-af55-44a14eac0f62\", \"9c6e8d6b-c385-4af6-bcb5-3e053abc8cd6\", \"9c6e8d6b-7456-4726-a917-00ba2b286621\"]',2.50,NULL,'2024-07-03 05:59:00','2024-07-03 06:00:58'),('9c6e8d80-d536-4fdc-8d0b-0399b038081b','{\"de\":\"L\\u00e4ssiges T-Shirt mit Rundhalsausschnitt\",\"fr\":\"T-shirt d\\u00e9contract\\u00e9 \\u00e0 col rond\",\"en\":\"Casual Crew Neck T-Shirt\"}','casual-crew-neck-t-shirt','{\"de\":\"Bleiben Sie l\\u00e4ssig und bequem in diesem vielseitigen T-Shirt mit Rundhalsausschnitt.\",\"fr\":\"Restez d\\u00e9contract\\u00e9 et confortable avec ce t-shirt polyvalent \\u00e0 col rond.\",\"en\":\"Stay casual and comfy in this versatile crew neck t-shirt.\"}','{\"de\":\"F\\u00fchlen Sie sich wohl in diesem l\\u00e4ssigen T-Shirt mit Rundhalsausschnitt. Das klassische Rundhalsdesign und der vielseitige Stil machen es perfekt f\\u00fcr entspannte Tage. Dieses T-Shirt ist aus weichen, atmungsaktiven Materialien gefertigt und bietet Ihnen Komfort. Ob f\\u00fcr ein Wochenende zu Hause oder einen l\\u00e4ssigen Tag unterwegs, es ist ein Muss in Ihrer Garderobe.\",\"fr\":\"Trouvez le confort dans ce t-shirt d\\u00e9contract\\u00e9 \\u00e0 col rond. Le design classique \\u00e0 col rond et le style polyvalent le rendent parfait pour les journ\\u00e9es d\\u00e9contract\\u00e9es. Fabriqu\\u00e9 \\u00e0 partir de mat\\u00e9riaux doux et respirants, ce t-shirt vous assure un confort optimal. Que ce soit pour un week-end \\u00e0 la maison ou une journ\\u00e9e d\\u00e9contract\\u00e9e, c&#39;est un incontournable de votre garde-robe.\",\"en\":\"Find comfort in this Casual Crew Neck T-Shirt. The classic crew neck design and versatile style make it perfect for laid-back days. Crafted from soft, breathable materials, this t-shirt keeps you comfortable. Whether for a weekend at home or a casual day out, it\'s a must-have in your wardrobe.\"}',14.99,'{\"de\":\"L\\u00e4ssiger Komfort\",\"fr\":\"Confort d\\u00e9contract\\u00e9\",\"en\":\"Casual Comfort\"}','{\"de\":\"Vielseitiger Rundhalsausschnitt f\\u00fcr unkomplizierte und entspannte Tage.\",\"fr\":\"Col rond polyvalent pour des journ\\u00e9es faciles et d\\u00e9contract\\u00e9es.\",\"en\":\"Versatile crew neck for easy and laid-back days.\"}',1,0,588,120,'M-T003',0,240,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-t-shirts-3.jpg\", \"file_name\": \"mens-t-shirts-3.jpg\"}','[\"9c6e8d6c-744c-4743-a97d-97da25389442\", \"9c6e8d6f-4548-4e14-86f0-444a311439be\", \"9c6e8d6c-3bbd-4f7f-af28-afbd08fdee29\", \"9c6e8d6b-fb2e-4785-af55-44a14eac0f62\", \"9c6e8d6b-c385-4af6-bcb5-3e053abc8cd6\", \"9c6e8d6b-7456-4726-a917-00ba2b286621\", \"9c6e8d71-1d03-460c-8ad0-32aa4dea0f06\", \"9c6e8d71-ecb4-4083-9530-d98741e9722f\", \"9c6e8d73-9dee-40c7-92c7-524ffd5db6ac\"]',3.14,NULL,'2024-07-03 05:59:02','2024-07-03 06:00:59'),('9c6e8d83-649d-4780-89e3-caf1a07f4c2f','{\"de\":\"Klassisches Oberhemd\",\"fr\":\"Chemise habill\\u00e9e classique\",\"en\":\"Classic Dress Shirt\"}','classic-dress-shirt','{\"de\":\"Zeitloser Stil in diesem klassischen Oberhemd.\",\"fr\":\"Style intemporel dans cette chemise habill\\u00e9e classique.\",\"en\":\"Timeless style in this classic dress shirt.\"}','{\"de\":\"Werten Sie Ihren formellen Look mit diesem klassischen Hemd auf. Das zeitlose Design und der hochwertige Stoff machen es perfekt f\\u00fcr jeden besonderen Anlass. Ob f\\u00fcr ein Gesch\\u00e4ftstreffen oder eine formelle Veranstaltung, dieses Hemd bietet sowohl Stil als auch Eleganz. Erh\\u00e4ltlich in verschiedenen Farben, passend zu Ihrem Ensemble.\",\"fr\":\"Rehaussez votre look formel avec cette chemise habill\\u00e9e classique. Son design intemporel et son tissu de haute qualit\\u00e9 le rendent parfait pour toute occasion sp\\u00e9ciale. Que ce soit pour une r\\u00e9union d&#39;affaires ou un \\u00e9v\\u00e9nement formel, cette chemise habill\\u00e9e offre \\u00e0 la fois style et sophistication. Disponible en diff\\u00e9rentes couleurs pour correspondre \\u00e0 votre ensemble.\",\"en\":\"Elevate your formal look with this Classic Dress Shirt. The timeless design and high-quality fabric make it perfect for any special occasion. Whether for a business meeting or a formal event, this dress shirt offers both style and sophistication. Available in various colors to match your ensemble.\"}',28.99,'{\"de\":\"Zeitlose Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance intemporelle\",\"en\":\"Timeless Elegance\"}','{\"de\":\"Perfekt f\\u00fcr formelle Veranstaltungen und Gesch\\u00e4ftstreffen.\",\"fr\":\"Parfait pour les \\u00e9v\\u00e9nements formels et les r\\u00e9unions d&#39;affaires.\",\"en\":\"Perfect for formal events and business meetings.\"}',2,0,147,160,'M-S001',0,220,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-shirt-1.jpg\", \"file_name\": \"mens-shirt-1.jpg\"}','[\"9c6e8d6c-744c-4743-a97d-97da25389442\", \"9c6e8d6c-3bbd-4f7f-af28-afbd08fdee29\", \"9c6e8d6b-fb2e-4785-af55-44a14eac0f62\", \"9c6e8d6b-c385-4af6-bcb5-3e053abc8cd6\", \"9c6e8d6b-7456-4726-a917-00ba2b286621\"]',4.00,NULL,'2024-07-03 05:59:03','2024-07-03 06:00:59'),('9c6e8d85-7567-4d16-af5f-e0749afb2b0f','{\"de\":\"Business Casual Hemd\",\"fr\":\"Chemise d\\u00e9contract\\u00e9e d&#39;affaires\",\"en\":\"Business Casual Shirt\"}','business-casual-shirt','{\"de\":\"Werten Sie Ihr B\\u00fcro-Outfit mit diesem Business-Casual-Hemd auf.\",\"fr\":\"Rehaussez votre tenue de bureau avec cette chemise business casual.\",\"en\":\"Elevate your office attire with this business casual shirt.\"}','{\"de\":\"Werten Sie Ihren professionellen Stil mit diesem Business-Casual-Hemd auf. Das moderne Design und die bequeme Passform machen es ideal f\\u00fcr das B\\u00fcro oder Gesch\\u00e4ftstreffen. Ob f\\u00fcr einen Arbeitstag oder eine Firmenveranstaltung, dieses Hemd verleiht Ihrer Garderobe einen Hauch von Eleganz.\",\"fr\":\"Am\\u00e9liorez votre style professionnel avec cette chemise professionnelle d\\u00e9contract\\u00e9e. Son design moderne et sa coupe confortable le rendent id\\u00e9al pour le bureau ou les r\\u00e9unions d&#39;affaires. Que ce soit pour une journ\\u00e9e de travail ou un \\u00e9v\\u00e9nement d&#39;entreprise, cette chemise ajoute une touche de sophistication \\u00e0 votre garde-robe.\",\"en\":\"Upgrade your professional style with this Business Casual Shirt. The modern design and comfortable fit make it ideal for the office or business meetings. Whether for a day at work or a corporate event, this shirt adds a touch of sophistication to your wardrobe.\"}',22.50,'{\"de\":\"Business-Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance commerciale\",\"en\":\"Business Elegance\"}','{\"de\":\"Ideal als B\\u00fcrokleidung und f\\u00fcr Firmenveranstaltungen.\",\"fr\":\"Id\\u00e9al pour les tenues de bureau et les \\u00e9v\\u00e9nements d&#39;entreprise.\",\"en\":\"Ideal for office attire and corporate events.\"}',1,0,369,190,'M-S002',0,210,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-shirt-2.jpg\", \"file_name\": \"mens-shirt-2.jpg\"}','[\"9c6e8d6c-744c-4743-a97d-97da25389442\", \"9c6e8d71-60f7-456b-8c3e-04c55e151b07\", \"9c6e8d6c-3bbd-4f7f-af28-afbd08fdee29\", \"9c6e8d6b-fb2e-4785-af55-44a14eac0f62\", \"9c6e8d6b-c385-4af6-bcb5-3e053abc8cd6\", \"9c6e8d6b-7456-4726-a917-00ba2b286621\", \"9c6e8d72-3467-43a4-be93-ab0ead9b5e0c\", \"9c6e8d73-1335-4db4-ada2-61cdf63bbf5d\"]',4.00,NULL,'2024-07-03 05:59:05','2024-07-03 06:00:59'),('9c6e8d87-d404-47b1-adad-1648c223681e','{\"de\":\"L\\u00e4ssiges kariertes Hemd\",\"fr\":\"Chemise \\u00e0 carreaux d\\u00e9contract\\u00e9e\",\"en\":