erten Sie Ihren Stil mit diesem Lederarmband auf.\",\"fr\":\"Am\\u00e9liorez votre style avec ce bracelet manchette en cuir.\",\"en\":\"Upgrade your style with this leather cuff bracelet.\"}','{\"de\":\"Mit diesem Lederarmband verleihen Sie Ihrem Stil einen neuen Touch. Das Ledermaterial und die stilvollen Details machen es perfekt f\\u00fcr einen modischen Look. Ob f\\u00fcr einen Abend mit Freunden oder einen besonderen Anlass, dieses Armband bietet Stil und Flair.\",\"fr\":\"Am\\u00e9liorez votre jeu de mode avec ce bracelet manchette en cuir. Le mat\\u00e9riau en cuir et les d\\u00e9tails \\u00e9l\\u00e9gants le rendent parfait pour un look tendance. Que ce soit pour une soir\\u00e9e entre amis ou une occasion sp\\u00e9ciale, ce bracelet offre \\u00e0 la fois style et flair.\",\"en\":\"Elevate your fashion game with this Leather Cuff Bracelet. The leather material and stylish details make it perfect for a fashionable look. Whether for a night out with friends or a special occasion, this bracelet offers both style and flair.\"}',18.99,'{\"de\":\"Trendige Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance tendance\",\"en\":\"Trendy Elegance\"}','{\"de\":\"Ledermaterial f\\u00fcr einen modischen Look.\",\"fr\":\"Mati\\u00e8re cuir pour un look tendance.\",\"en\":\"Leather material for a fashionable look.\"}',2,0,46,185,'M-BR001',0,280,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-jewellery-1.jpg\", \"file_name\": \"mens-jewellery-1.jpg\"}','[]',NULL,NULL,'2024-07-03 06:00:41','2024-07-03 06:00:59'),('9c6e8e1a-c05f-438b-8943-16a200e36e4c','{\"de\":\"Gliederarmband aus Edelstahl\",\"fr\":\"Bracelet \\u00e0 maillons en acier inoxydable\",\"en\":\"Stainless Steel Link Bracelet\"}','stainless-steel-link-bracelet','{\"de\":\"Verleihen Sie Ihrem Outfit mit diesem Gliederarmband aus Edelstahl einen Hauch von Eleganz.\",\"fr\":\"Ajoutez une touche d&#39;\\u00e9l\\u00e9gance avec ce bracelet \\u00e0 maillons en acier inoxydable.\",\"en\":\"Add a touch of elegance with this stainless steel link bracelet.\"}','{\"de\":\"Werten Sie Ihren Stil mit diesem Gliederarmband aus Edelstahl auf. Das Edelstahlmaterial und das klassische Design machen es perfekt f\\u00fcr einen raffinierten Look. Ob f\\u00fcr eine formelle Veranstaltung oder ein Gesch\\u00e4ftstreffen, dieses Armband ist eine vielseitige Erg\\u00e4nzung Ihrer Sammlung.\",\"fr\":\"Am\\u00e9liorez votre style avec ce bracelet \\u00e0 maillons en acier inoxydable. Le mat\\u00e9riau en acier inoxydable et le design classique le rendent parfait pour un look raffin\\u00e9. Que ce soit pour un \\u00e9v\\u00e9nement formel ou une r\\u00e9union d&#39;affaires, ce bracelet est un ajout polyvalent \\u00e0 votre collection.\",\"en\":\"Upgrade your style with this Stainless Steel Link Bracelet. The stainless steel material and classic design make it perfect for a refined look. Whether for a formal event or a business meeting, this bracelet is a versatile addition to your collection.\"}',22.50,'{\"de\":\"Zeitloser Charme\",\"fr\":\"Charme intemporel\",\"en\":\"Timeless Charm\"}','{\"de\":\"Edelstahl f\\u00fcr einen Hauch von Eleganz.\",\"fr\":\"L&#39;acier inoxydable pour une touche d&#39;\\u00e9l\\u00e9gance.\",\"en\":\"Stainless steel for a touch of elegance.\"}',1,0,45,195,'M-BR002',0,285,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-jewellery-2.jpg\", \"file_name\": \"mens-jewellery-2.jpg\"}','[]',NULL,NULL,'2024-07-03 06:00:43','2024-07-03 06:00:59'),('9c6e8e1c-c448-49d1-9a67-7cbe414e208d','{\"de\":\"Perlenarmband\",\"fr\":\"Bracelet \\u00e0 breloques perl\\u00e9\",\"en\":\"Beaded Charm Bracelet\"}','beaded-charm-bracelet','{\"de\":\"Bleiben Sie stilvoll mit diesem Perlenarmband.\",\"fr\":\"Restez \\u00e9l\\u00e9gant avec ce bracelet \\u00e0 breloques en perles.\",\"en\":\"Stay stylish with this beaded charm bracelet.\"}','{\"de\":\"Mit diesem Perlenarmband verleihen Sie Ihrem Modestil ein neues Niveau. Das Perlendesign und die trendigen Details machen es perfekt f\\u00fcr einen modischen Look. Ob f\\u00fcr einen l\\u00e4ssigen Tag oder eine Party, dieses Armband bietet Stil und Flair.\",\"fr\":\"Am\\u00e9liorez votre jeu de mode avec ce bracelet \\u00e0 breloques en perles. Le design perl\\u00e9 et les d\\u00e9tails tendance le rendent parfait pour un look tendance. Que ce soit pour une journ\\u00e9e d\\u00e9contract\\u00e9e ou une f\\u00eate, ce bracelet offre \\u00e0 la fois style et style.\",\"en\":\"Elevate your fashion game with this Beaded Charm Bracelet. The beaded design and trendy details make it perfect for a fashionable look. Whether for a casual day out or a party, this bracelet offers both style and flair.\"}',24.99,'{\"de\":\"Stilvolle Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance \\u00e9l\\u00e9gante\",\"en\":\"Stylish Elegance\"}','{\"de\":\"Perlendesign f\\u00fcr einen modischen Look.\",\"fr\":\"Design perl\\u00e9 pour un look tendance.\",\"en\":\"Beaded design for a fashionable look.\"}',2,0,47,190,'M-BR003',0,290,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-jewellery-3.jpg\", \"file_name\": \"mens-jewellery-3.jpg\"}','[]',NULL,NULL,'2024-07-03 06:00:44','2024-07-03 06:00:59');
